import React, { useEffect } from "react";
import { NavLink } from "react-router-dom";

import "./matchSelector.css";
function MatchTypeSelector(props) {
  useEffect(() => {
    const showSMTH = () => {
      const active_register = document.getElementsByClassName(
        "active_register"
      )[0];
      const unactive_register = document.getElementsByClassName(
        "unactive_register"
      )[0];
      const active_stats = document.getElementsByClassName("active_stats")[0];
      const unactive_stats = document.getElementsByClassName(
        "unactive_stats"
      )[0];
      if (props.active === "register") {
        unactive_register.style.display = "none";
        active_stats.style.display = "none";
        unactive_stats.style.marginTop = "10px";
      }
      if (props.active === "stats") {
        active_register.style.display = "none";
        unactive_stats.style.display = "none";
      }
    };
    showSMTH();
  });
  return (
    <div>
      <br />
      <div className="row">
        <div className="col-1"></div>
        <NavLink to="/matchscouting">
          <div className="col-5 active_register">
            <h6 className="tab" style={{ paddingBottom: "20px" }}>
              Register Match
            </h6>
          </div>
        </NavLink>
        <div className="col-5 unactive_register">
          <h6 className="" style={{ paddingBottom: "20px" }}>
            Register Match
          </h6>
        </div>
        <div className="col-1"></div>
        <div className="col-4 active_stats">
          <h6 className="tab">Match Stats</h6>
        </div>
        <div className="col-4 unactive_stats">
          <h6>Match Stats</h6>
        </div>
        <div className="col-1"></div>
      </div>
    </div>
  );
}

export default MatchTypeSelector;
